import React, {Component,Fragment} from 'react';
import {BrowserRouter} from "react-router-dom";
import AppRoute from "./router/AppRoute";
class App extends Component {
    render() {
        return (
            <Fragment>
                <BrowserRouter>
                    <AppRoute/>
                </BrowserRouter>
            </Fragment>
        );
    }
}

export default App;
